/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `biz_vehicle_type` (
  `type_id` char(32) NOT NULL,
  `type_name` varchar(50) NOT NULL COMMENT '代码',
  `org_id` varchar(45) NOT NULL COMMENT '机构ID',
  `mark` int(1) DEFAULT NULL COMMENT '模板标识  0:公共模板；1私有模板',
  `brand` varchar(50) DEFAULT NULL COMMENT '品牌',
  `model_name` varchar(45) DEFAULT NULL COMMENT '型号名称',
  `powerrating` int(6) DEFAULT NULL COMMENT '额定功率',
  `classify` varchar(50) DEFAULT NULL COMMENT '所属分类',
  `size` varchar(45) DEFAULT NULL COMMENT '尺寸',
  `in_use` int(1) DEFAULT NULL COMMENT '0:未使用；1：使用',
  `v_org_id` varchar(45) DEFAULT NULL COMMENT '车型的机构ID',
  `is_intelligent` bit(1) DEFAULT NULL COMMENT '是否是智能终端',
  `is_filter_missing_column` bit(1) DEFAULT NULL COMMENT '是否过滤丢失字段\n0、不过滤；1、过滤',
  PRIMARY KEY (`type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
